import React, {useContext} from 'react';
import Feed from './Feed/Feed';
import {UserContext} from "../../utils/UserContext";


export default function Feeds(props) {
    const {globalUserObject, setGlobalUserObject} = useContext(UserContext);

    function click(event) {
        console.log(event);
        setGlobalUserObject(event);
        console.log(globalUserObject.UserId);
    }
    return props.events.map((event, index) => {
        return (

            <Feed
            click={() => click(event)}
            name={event.event_name}
            app={event.app}
            appdes={event.app_description}
            entree={event.entree}
            entreedes={event.entree_description}
            dessert={event.dessert}
            dessertdes={event.dessert_description}
            key={event.id}
            />
        )
    });
};
